import './homeNav.css';
import {Link, useNavigate} from 'react-router-dom';
import logo from '../../images/air.jpg'
import { useEffect } from 'react';
//import { Navigate, useNavigate,useLocation } from 'react-router-dom';
//import { useEffect, useState } from 'react';
//import MyDesignes from '../Mydesignes/mydesignes';

export  function HomeNav(props){
    return(
            <div className="Nav">
                <nav>
                <div className='logoa'>
                <Link className="prova" to="/"><img className='logo' alt="" src={logo}/></Link>
                </div>
                </nav>
            </div>

    )
}

export  function UserNav(){
    const {ethereum}=window;

    useEffect(async()=>{
        const accounts = await ethereum.request({ method: 'eth_accounts' });
        if(!accounts)
            useNavigate('/')

    })

    return (
        <div className="Nav">
                <nav>
                <div className='logoa'>
                <Link className="prova" to="/"><img className='logo' alt="" src={logo}/></Link>
                <Link to="/mydesignes" >My Design</Link>
                <Link to="/myprinters">My printers</Link>

                </div>
                </nav>
            </div>

    )
}
